import React,{Component} from 'react';
import ReactDOM from 'react-dom';
import './CommonComponent.css';
import CharacterList from './CharacterList';
import 'tachyons';


const Commoncomponent=(props)=>{
	return <div>
			<h1> Wekcome profesionals</h1>
            <CharacterList id="1" name="Pari" work="Developer"/>
            <CharacterList id="2" name="gagan" work="Developer"/>
            <CharacterList id="3" name="love" work="Developer"/>
            <CharacterList id="4" name="kush" work="Developer"/>
            <button> subscribe </button></div>
}
export default Commoncomponent;
